description:
&quot;Cyberman&quot; is a Doctor Who spin-off audio series made by Big Finish,
about the Orion War between Mankind, Androids and Cybermen.

Contains:
- As prequel, &quot;Sword of Orion&quot; from the main Doctor Who audio series,
with the Eighth Doctor and Charley.

- The &quot;Cyberman&quot; spin-off series itself,
with two seasons of 4 episodes each.



If your media player can't read .m4a try changing the extension to .m4b
If it still doesn't work, update codecs or change player.

